window.bookSummaryJSON = "<p>Nine years ago, best-selling author and business consultant Mark Sanborn introduced the world to Fred, his postman, who delivered extraordinary service in simple but remarkable ways. Fred’s story inspired millions. Companies - even, cities - were inspired to turn the ordinary into the extraordinary each day. Today, with stiff competition from the networked global economy, delivering extraordinary results is more important than ever. With <i>Fred 2.0,</i> Mark not only revisits the original <i>Fred</i> to gain new insights, but also equips all of us with new strategies to achieve more. You’ll not only be inspired by <i>Fred 2.0,</i> you’ll also have the tools and strategies to aim higher and achieve the extraordinary. </p>"; 
